import styled from 'styled-components';

const StyleLoginButton = styled.div`
    .btn-signin {
        color: #fff;
        font-size: 1.1rem;
    }
    .btn-signup {
        color: #fff;
        font-size: 1.1rem;
        border: 1px solid white;
    }

`;


export {StyleLoginButton};
